import React from "react"
import {NavLink} from "react-router-dom"
export default function MNav(){
    return (
        <Nav className="m-Nav">
            <div className="m-navlink">
                <NavLink activeClassName="active" to="">推荐音乐</NavLink> 
                <NavLink activeClassName="active" to="">热歌榜</NavLink> 
                <NavLink activeClassName="active" to="">搜索</NavLink> 
            </div>
        </Nav>
    )
}
